import React from "react"
import Card from './Card'

const GameBoard = (props) => {
	return <div id="gameBoard">
        {props.cards.map((card, index) => 
            <Card card={card} key={card.id} flipCard={props.flipCard}></Card>
        )}
    </div>
}

export default GameBoard
